jQuery(document).ready(function() {

	// First And Last //
	$("p:first-child, ul:first-child, li:first-child").addClass('first');
	$("p:last-child, ul:last-child, li:last-child").addClass('last');

	$(window).scroll(function() {
	if ($(this).scrollTop() > 1){  
		$('.headerMain').addClass("sticky");
		}
		else{
		$('.headerMain').removeClass("sticky");
		}
	});

	$('.carouselBlog').slick({
		dots: false,
		prevArrow: false,
    	nextArrow: false,
		infinite: true,
		centerMode: true,
		autoplay: true,
		autoplaySpeed: 3000,
		speed: 1200,
		slidesToShow: 4,
		slidesToScroll: 1,
		responsive: [
		  {
			breakpoint: 1400,
			settings: {
			  slidesToShow: 3,
			  slidesToScroll: 3
			}
		  },
		  {
			breakpoint: 992,
			settings: {
			  slidesToShow: 2,
			  slidesToScroll: 2
			}
		  },
		  {
			breakpoint: 640,
			settings: {
			  slidesToShow: 1,
			  slidesToScroll: 1
			}
		  }
		  // You can unslick at a given breakpoint now by adding:
		  // settings: "unslick"
		  // instead of a settings object
		]
	});

	$('.carouselMedia').slick({
		dots: false,
		prevArrow: false,
    	nextArrow: false,
		infinite: true,
		autoplay: true,
		autoplaySpeed: 2000,
		speed: 1200,
		slidesToShow: 3,
		slidesToScroll: 1,
		responsive: [
		  {
			breakpoint: 992,
			settings: {
			  slidesToShow: 2,
			  slidesToScroll: 2
			}
		  },
		  {
			breakpoint: 640,
			settings: {
			  slidesToShow: 1,
			  slidesToScroll: 1
			}
		  }
		  // You can unslick at a given breakpoint now by adding:
		  // settings: "unslick"
		  // instead of a settings object
		]
	});

	$('.secBlog .nextButton').click(function(){
		$(".carouselBlog").slick('slickNext');
	});

	$('.secBlog .prevButton').click(function(){
		$(".carouselBlog").slick('slickPrev');
	});
	
	$('.carouselTestimonial').slick({
		dots: true,
		prevArrow: false,
    	nextArrow: false,
		infinite: true,
		autoplay: true,
		autoplaySpeed: 3000,
		speed: 1200,
		slidesToShow: 2,
		slidesToScroll: 2,
		responsive: [
		  {
			breakpoint: 800,
			settings: {
			  slidesToShow: 1,
			  slidesToScroll: 1
			}
		  }
		  // You can unslick at a given breakpoint now by adding:
		  // settings: "unslick"
		  // instead of a settings object
		]
	});

	// Accordians //
	/*$(".questAns:first-child" ).addClass('active');*/
	$(".faq .quest").click(function() {
		var dis = $(this);
		var quest = dis.parent();
		
		if (quest.hasClass('active')){
			quest.find('.ans').slideUp();
			quest.removeClass('active');
		} else {
			quest.siblings().removeClass('active').find('.ans').slideUp();
			quest.find('.ans').slideDown();
			quest.addClass('active');	
		}
	});

	$(".dropdown-toggle").dropdown();

	$('input.calendar').pignoseCalendar({
		format: 'YYYY-MM-DD',
		minDate: moment().subtract(1, 'days'),
		week: 1
	});

	$(".quickButton").click(function(e) {
		e.preventDefault();
		var tgt = $('body').find('.divSticky');
		
		if (tgt.hasClass('hide')){
			tgt.removeClass('hide');
		}
	});

	$(".divSticky .clickButton").click(function(e) {
		e.preventDefault();
		var dis = $(this);
		var tgt = dis.parents('.divSticky');
		
		if (tgt.hasClass('hide')){
			tgt.removeClass('hide');
		}
	});

	$(".divSticky .closeButton").click(function(e) {
		e.preventDefault();
		var dis = $(this);
		var tgt = dis.parents('.divSticky');
		
		tgt.addClass('hide');
	});

	$(document).mouseup(function(e) {
		var container = $(".divSticky");
		// if the target of the click isn't the container nor a descendant of the container
		if (!container.is(e.target) && container.has(e.target).length === 0)  {
			container.addClass('hide');
		}
	});


	$(".selectPrice li").click(function() {
		var dis = $(this);
		var tgt = dis.parents('.rowPrice').find('.priceField');
		var dol = $(this).find('span').text();
		
		dis.addClass('active').siblings().removeClass('active');
		tgt.find('input').val(dol);	

	});

	$(".amountList li").click(function() {
		var dis = $(this);
		var tgt = dis.parents('.amountDiv').find('.amountSet');
		var dol = $(this).text();
		console.log(dol);
		
		dis.addClass('active').siblings().removeClass('active');
		tgt.val(dol);	

	});


	$('.dropBaby').on('change', function() {
			var value = $(this).val();
			if(value==='Other'){
				$('#otherProviderDiv').css('display','block');	
			}else{
				$('#otherProviderDiv').css('display','none');
				$(this).parents('body').find('.suggestionField').val(value);			
			}
	  });

	$('#providerModal').on('hidden.bs.modal', function (e) {
		if($('.dropBaby').val()==='Other'){
			$('input.suggestionField').val($("#other_provider").val());
		}
	});
		
	$(".header-search i").click(function(event) {
		var bar = $(this).parents('.header-search').find('.searchDesktop');
		event.stopPropagation();
		bar.toggleClass('active');
	});

	var slider = document.getElementById("myRange");
	var output = document.getElementById("demo");
	output.innerHTML = slider.value;
	slider.oninput = function() {
		output.innerHTML = this.value;
	}
});


